import React from "react";
import { Routes, Route } from "react-router-dom";
//import Nav from "./Nav/Nav"; // مكون الـ Navigation
//import Home from "./Pages/Home"; // الصفحة الرئيسية
import About from "./Pages/About"; // صفحة About
//import Page3 from "./Pages/Page3"; // صفحة Page3
//import Page4 from "./Pages/Page4"; // صفحة Page4
//import Page5 from "./Pages/Page5"; // صفحة Page5
//import Page6 from "./Pages/Page6"; // صفحة Page6

function App() {
  return (
    <div>
      <Nav />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/page5" element={<About />} />
        <Route path="/page3" element={<Page3 />} />
        <Route path="/page4" element={<Page4 />} />
        <Route path="/page6" element={<Page6 />} />
        <Route path="*" element={<h1>Page Not Found</h1>} /> {/* 404 */}
      </Routes>
    </div>
  );
}

export default App;
